(3, 'mhfcjx1421158741', 54, 33, 13, 20, 7, 5, 3, 9999, 'http://mp.weixin.qq.com/s?__biz=MzAwNzIxMjc2Ng==&amp;mid=206151606&amp;idx=1&amp;sn=48392b9200ba272164bc850e1c17dfc6#rd', '/uploads/m/mhfcjx1421158741/3/8/f/9/thumb_54b53159d53ca.gif', '&lt;p class=&quot;MsoListParagraph&quot; style=&quot;margin-left:36.0pt;text-indent:-36.0pt;&quot;&gt;\r\n	&lt;span style=&quot;line-height:1.5;color:#FFFFFF;background-color:#E53333;&quot;&gt;一、 已付款&lt;/span&gt;&lt;span style=&quot;line-height:1.5;color:#FFFFFF;background-color:#E53333;&quot;&gt;订单佣金：&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	您的连锁分店已经成功付款，&lt;span style=&quot;line-height:1.5;&quot;&gt;产品待发的订单所产生的佣金。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;span style=&quot;line-height:1.5;color:#FFFFFF;background-color:#E53333;&quot;&gt;二、 未收货&lt;/span&gt;&lt;span style=&quot;line-height:1.5;color:#FFFFFF;background-color:#E53333;&quot;&gt;订单佣金：&lt;/span&gt; \r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	产品已经发出&lt;span&gt;的订单所产生的佣金&lt;/span&gt;，还在以下阶段：\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span&gt;1&lt;/span&gt;、&lt;span&gt;产品还在快递送达的路上；&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span&gt;2&lt;/span&gt;、&lt;span style=&quot;line-height:1.5;&quot;&gt;产品已经送达，但他还没有点击确认收货。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoListParagraph&quot; style=&quot;margin-left:36.0pt;text-indent:-36.0pt;&quot;&gt;\r\n	&lt;span style=&quot;color:#FFFFFF;background-color:#E53333;&quot;&gt;三、&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color:#FFFFFF;background-color:#E53333;&quot;&gt;已收货订单佣金：&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoListParagraph&quot; style=&quot;margin-left:36.0pt;text-indent:-36.0pt;&quot;&gt;\r\n	&lt;span&gt;1&lt;/span&gt;、产品已经送达，您的连锁分店已经\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoListParagraph&quot; style=&quot;margin-left:36.0pt;text-indent:-36.0pt;&quot;&gt;\r\n	点击确认收货；\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoListParagraph&quot; style=&quot;margin-left:36.0pt;text-indent:-36.0pt;&quot;&gt;\r\n	&lt;span&gt;2&lt;/span&gt;、他收货后没有点击确认收货，而是\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoListParagraph&quot; style=&quot;margin-left:36.0pt;text-indent:-36.0pt;&quot;&gt;\r\n	&lt;span style=&quot;line-height:1.5;&quot;&gt;等待7天后由系统自动默认为确认收货&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoListParagraph&quot; style=&quot;margin-left:36.0pt;text-indent:-36.0pt;&quot;&gt;\r\n	&lt;span style=&quot;color:#FFFFFF;background-color:#E53333;&quot;&gt;四、&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color:#FFFFFF;background-color:#E53333;&quot;&gt;可提现佣金总额&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	1、可以申请提现到自己银行卡的佣金总额；\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	2、点击申请提现，填写您的提现金额，点击提交；\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoListParagraph&quot; style=&quot;margin-left:36.0pt;text-indent:-36.0pt;&quot;&gt;\r\n	&lt;span style=&quot;color:#FFFFFF;background-color:#E53333;&quot;&gt;五、&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color:#FFFFFF;background-color:#E53333;&quot;&gt;已提现佣金总额&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	已经红包发放给您的佣金总额。\r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoListParagraph&quot; style=&quot;margin-left:36.0pt;text-indent:-36.0pt;&quot;&gt;\r\n	&lt;span style=&quot;color:#FFFFFF;background-color:#E53333;&quot;&gt;六、&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color:#FFFFFF;background-color:#E53333;&quot;&gt;已退款订单佣金&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span&gt;您的连锁分店因为特殊原因而退款，已计算佣金将由系统自动解除。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;');
