(132, 0, 38, 0, '健美生番茄红素复合片', 159, 159, 159, 15, 12, 10, '', '&lt;p&gt;\n	产品名称 加拿大原装健美生番茄红素复合片(620mg*60片) 产品基本信息 【主要成分】番茄红素、成熟番茄浓缩物、纤维素、磷酸氢钙等 【适宜人群】&lt;br /&gt;\n1、前列腺疾病、肿瘤患者；&lt;br /&gt;\n2、生活在环境污染严重地区者；&lt;br /&gt;\n3、免疫力较低的中老年人群；&lt;br /&gt;\n4、抗氧化，需延缓衰老者；&lt;br /&gt;\n5、成年人、女人、老人；&lt;br /&gt;\n6、免疫力低下者；&lt;br /&gt;\n7、冠心病患者；&lt;br /&gt;\n8、肿瘤患者；&lt;br /&gt;\n9、经常吸烟者等。 【食用方法】每日1次，每次1片，随餐食用 【规 格】620mg*60片 【原 产 地】加拿大 【保 质 期】3年 产品介绍 男人前列腺问题的主要原因是人体内缺少足够的抗氧化剂，而番茄红素是目前在自然界的植物中被发现的最强抗氧化剂之一，它被誉为“液体黄金”。它可以帮助预防和改善前列腺增生、前列腺炎等泌尿系统疾病；其次，它也有助于提高男性精子质量，降低不育防线，有效增强男性的生育能力；此外，男性每天在饮食中服用最大剂量的番茄红素（每天6.5毫克以上）比服用最少者相比，可以使前列腺癌的发生减少21% 番茄红素被誉为“抗衰老能手”。研究发现，番茄红素含有强氧化、抗辐射的生物活性物质，可以有效地防止自由基、紫外线及各种外部辐射对皮肤细胞的损害，促进细胞的生长和再生，保持细胞底层正常代谢，有效防止色斑、皱纹、衰老。其次，番茄红素在增强抵抗力，防癌抗癌方面效果也很好，被联合国粮食组织和世界卫生组织认定为A类营养素。因此，它可以预防女人衰老；其次，它可以增强免疫力，恢复体能；再者，它可以抑制包括乳腺癌、肺癌、胃癌及内皮组织癌细胞的生长；最后，发现血清中含较高番茄红素的妇女，患子宫颈癌的几率降低。 自由基造成的退化效应，是心血管疾病的头号元凶，血液中番茄红素浓度高者发生老年性黄斑病变的机会可减少50%。根据欧洲10个国家的研究报告得出结论：每天40ml番茄红素，能明显降低冠心病的风险。番茄红素可以防止血中低密度脂蛋白氧化，因而能减少动脉粥样和冠心病的患病危险。其次，它可以预防及改善老年男性常见疾病的前列腺增生和前列腺炎等；此外，它还可以预防和改善白内障及老年性黄斑病变。 产品特点、优势 1、高含量。番茄红素在番茄中的含量最高，而1粒相当于吃200个番茄； 2、超强抗氧化能力。氧化能力最强的天然物质，其氧化能力是胡萝卜的3.2倍，是维生素E的100倍； 3、纯度达到医药级别，吸收效果好。通过健美生专业的360超程度检测程序，技术可靠，纯植物配方，不含动物性成分，素食者可以放心食用，无毒副作用； 4、加拿大原装进口。原料来自全世界最好的无污染区域，原料100%纯天然，严格筛选，确保原料的等级和纯度。 5、无一例外地用苛刻的尺度进行农药残留、重金属、辅助溶剂和微生物检验，保证原料绝对的无毒、无污染。 产品其他相关 【注意事项】产品以收到实物为准！ 健美生是世界三大营养保健品企业之一,加拿大第一品牌。Jamieson是世界第一维生素品牌 ,也是生产和制作工艺最尖端的保健品企业，产品生物活性强，最易于人体吸收和利用，被誉为是全球最安全的保健品品牌。健美生的产品原料来自世界上环境最好的无污染区域，进行全球天然采集：从热带雨林、沙漠、湿地、高原、原始森林、深海、极地、冰川，确保原料100%纯天然。生产工厂周围300公里无工业污染，确保了产品高质高效。&amp;nbsp;\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132753_42165.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132754_15657.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132754_89300.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132755_32860.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132756_84779.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132756_71162.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132757_71962.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132757_32319.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132758_10301.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132758_79535.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132759_64210.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132759_89681.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132759_60658.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132759_55402.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132800_55114.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132800_12671.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132800_56139.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132801_83851.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;/p&gt;', 'mhfcjx1421158741', '健美生番茄红素复合片', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453536272_srbmc398d5sa0k4m.jpg', 0, 0, 0, 52, 1456281125, 8610, 0, 0),
