(130, 0, 37, 0, '健美生奶蓟提取物浓缩片', 299, 299, 299, 15, 12, 10, '', '产品名称 健美生奶蓟提取物浓缩片(700mg*90片) 产品基本信息 【主要成分】奶蓟浓缩提取物、磷酸氢钙、纤维素、水溶性纤维素、聚乙二醇等 【适宜人群】各类肝炎，酒精肝，脂肪肝，肝硬化，肝脏功能失常者； 经常饮酒者及作息不规律者； 胃、脾、胆和肾脏功能欠佳者 【食用方法】每日1-2次，每次1片，随餐食用 【规 格】700mg*90片 【原 产 地】加拿大 【保 质 期】3年 产品介绍 Jamieson 健美生奶蓟提取物浓缩片700mg*90片(进口)，奶蓟也叫水飞蓟，广泛分布在南欧及北美,奶蓟草的叶片非常漂亮，其上有许多白色的叶脉，可供药用及观赏利用，同时也是优良的护肝植物。它的茎和叶片切开时，会流出乳白色的乳汁。欧洲在2000年前就知道奶蓟对肝脏及胆的功效。奶蓟草现应用于现代临床治疗和营养滋补，其主要是使用种子及叶子，从种子萃取出的萃取物，有改善肝功作用，保护肝细胞膜，对肝脏有解毒作用.奶蓟不仅保护和改善肝、胆、脾、肾的功能，而且对肝硬化、脂肪肝、肝中毒、胆囊炎、胆囊周围炎、胆石症的疼痛等多种肝胆疾病也有辅助疗效。德国天然药草研究委员会认可奶蓟草是一种高度安全、非常有效的肝脏保护药草。&amp;nbsp;&lt;br /&gt;\n&lt;br /&gt;\n&lt;br /&gt;\n产品特点、优势 1、优质原料：以东欧水飞蓟种子为原料，液体技术提取，不含酒精及其他化学原料； 2、超浓缩，纯天然：以30:1比例超浓缩而成，纯天然植物护肝产品，无依赖性； 3、通过健美生专有的 360 超纯度检测程序，贯穿于检测、生产、包装全过程，保证原料的可靠性、可追溯性、产品的安全性、高效性和医药级别的纯度。&amp;nbsp;&lt;br /&gt;\n产品其他相关 【注意事项】产品以收到实物为准！&amp;nbsp;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160123/20160123155521_73402.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160123/20160123155521_54237.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160123/20160123155521_17620.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160123/20160123155522_22487.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160123/20160123155522_67759.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160123/20160123155533_84185.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160123/20160123155533_64017.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160123/20160123155534_87594.jpg&quot; alt=&quot;&quot; /&gt;&