(135, 0, 39, 0, '汉诺金艾伯顿薯蓣粉浓缩片(5184)', 1654, 1654, 1654, 15, 12, 10, '', '产品名称&lt;br /&gt;\n汉诺金艾伯顿薯蓣片(60片)&lt;br /&gt;\n产品基本信息&lt;br /&gt;\n【主要成分】薯蓣提取物、甘草提取物、木糖醇&lt;br /&gt;\n【适宜人群】18岁以上男性人群；中老年男性；三高人群；阳痿患者&lt;br /&gt;\n【食用方法】每日1-2片；服用十天后每日1片&lt;br /&gt;\n【产品规格】62g(1033mg*60片）&lt;br /&gt;\n【原 产 国】芬兰&lt;br /&gt;\n【保 质 期】三年&lt;br /&gt;\n产品介绍&lt;br /&gt;\n本品由芬兰原产薯蓣和甘草为原料，经汉诺金专利技术萃取的天然植物提取物，还添加了纯桦树木糖醇，富含原薯蓣皂甙等有益成份。&lt;br /&gt;\n芬兰北极圈地区森林密布，水量充沛，夏季日照时间平均长达16个小时。生长于此的芬兰野生薯蓣富含原薯蓣皂甙，能量充沛，活力十足。野生薯蓣在不同的地域文化中有着不同的用途。希腊人把它当作一种情绪稳定剂来使用，印度和中国人把它当作利尿剂和抗感染抗炎症药剂来使用，同时，它对皮肤的保湿作用和催情剂功能也备受青睐。&lt;br /&gt;\n原薯蓣皂甙&lt;br /&gt;\n天然的原薯蓣皂甙不是激素，能有效调节男性的荷尔蒙功能，保持健康强壮的体魄。原薯蓣皂甙有降血压、降血脂、抵御动脉粥硬化，延缓衰老及强壮作用。其中所含的过氧化物分解酶，具有明显的抵御衰老作用，可以提高肌体免疫力。&lt;br /&gt;\n最近几十年来，由于它具有调节荷尔蒙的功能，芬兰、保加利亚和中国的科学家对原薯蓣皂甙进行了深入的研究。&lt;br /&gt;\n产品特点、优势&lt;br /&gt;\n1、富含原薯蓣皂苷，提别添加甘草根提取物；&lt;br /&gt;\n2、生产技术领先，通过GMP认证并经过诺华实验室检测。&lt;br /&gt;\n3、工艺萃取技术领先，采用芬兰极地天然薯蓣，不含添加剂、激素、乳糖、酵母、麸质等。&lt;br /&gt;\n芬兰野生薯蓣的营养作用&lt;br /&gt;\n1、植物类男性荷尔蒙调节剂，不含激素，安全可靠；&lt;br /&gt;\n2、补肾壮阳、增强男性性欲和性能力；&lt;br /&gt;\n3、预防和辅助治疗阳痿和前列腺疾病，改善尿频；&lt;br /&gt;\n4、预防高血压、高血脂、动脉粥样硬化，抗衰老，强壮身体。&lt;br /&gt;\n产品其他相关&lt;br /&gt;\n【注意事项】产品以收到实物为准！&lt;br /&gt;\n【健康小贴士】&lt;br /&gt;\n芬兰野生薯蓣是植物类男性荷尔蒙调节剂，不含激素，安全可靠；&lt;br /&gt;\n芬兰野生薯蓣可以补肾壮阳、增强男性性欲和性能力；&lt;br /&gt;\n&lt;p&gt;\n	芬兰野生薯蓣能够减少和辅助改善阳痿；芬兰野生薯蓣能够减少高血压、高血脂、动脉粥样硬化，抵御衰老，强壮身体。\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132914_10185.png&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132915_68476.png&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223132916_65905.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;/p&gt;', 'mhfcjx1421158741', '汉诺金艾伯顿薯蓣粉浓缩片(5184)', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453536625_yqycy2poiixcqpjg.jpg', 0, 0, 0, 52, 1456281137, 4510, 0, 0),
