(160, 0, 50, 0, '玉泽清痘调护平衡乳', 119, 119, 119, 15, 12, 10, '', '&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160222/20160222163106_50707.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160222/20160222163108_44423.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160222/20160222163109_86445.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160222/20160222163111_31785.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160222/20160222163112_30496.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;br /&gt;', 'mhfcjx1421158741', '玉泽清痘调护平衡乳', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453539556_ke04kd700p149w7t.jpg', 0, 0, 0, 45, 1456281473, 999, 0, 0),
(161, 0, 42, 0, '汉诺金卡诺麦斯冰海鳗鱼浓缩片(5345)', 2374, 2374, 2374, 15, 12, 10, '', '产品名称&lt;br /&gt;\n汉诺金卡诺麦斯冰海鳗鱼浓缩片(60片)&lt;br /&gt;\n产品基本信息&lt;br /&gt;\n【主要成分】L-肌肽、天然维生素E&lt;br /&gt;\n【成分含量】每片含400mg L-肌肽&lt;br /&gt;\n【适宜人群】18岁以上人群；中老年人群；肌体老化人群；肌体重大创伤人群；长期吸烟及被动吸烟人群；老花眼、老年白内障、老年黄斑变性、老年退行性眼病潜在人群&lt;br /&gt;\n【食用方法】每日1-2片，餐后半小时大量温水送服&lt;br /&gt;\n【产品规格】60g(1000mg*60片)&lt;br /&gt;\n【原 产 国】芬兰&lt;br /&gt;\n【保 质 期】三年&lt;br /&gt;\n产品介绍&lt;br /&gt;\n本品由北极圈附近波罗的海捕捞的冰海鳗鱼心脏为主要原料经汉诺金专利生物萃取技术精制而成。每片含400mg L-肌肽（CARNOSINE)。&lt;br /&gt;\n肌肽 肌肽是天然的缩二氨酸，在多种动物尤其长寿物种的肌肉和神经组织中含量极高。芬兰汉诺金出品的肌肽的原料来自于北欧波罗的海北极圈内捕捞的冰海鳗鱼。&lt;br /&gt;\n最近科学研究表明，肌肽可以延长细胞的寿命，使衰老细胞恢复活力，抑制淀粉肽，丙二醛和次氯酸盐对细胞的毒性作用。肌肽能透过血脑屏障，激活和促进神经细胞蛋白质合成，提供和补充神经代谢所需要的特异性营养物质，补充脑营养，促进脑神经新陈代谢，能够为生命活动及机体病变修复提供高效能量补充和营养支持。&lt;br /&gt;\n肌肽已经成为人类对抗衰老和肌体老化的重要营养素，被世界各地影视明星及政客所忠爱，广泛使用于高档化妆品、营养品及注射制剂。&lt;br /&gt;\n天然维生素E&lt;br /&gt;\n天然维生素E的抵御氧化作用明显保持了肌肽的生物活性，帮助人体持续吸收和生物利用肌肽。&lt;br /&gt;\n产品特点、优势&lt;br /&gt;\n1、原料取自北欧波罗的海北极圈内冰海鳗鱼，纯天然无污染。&lt;br /&gt;\n2、卫生安全、功效卓著、质优量足。&lt;br /&gt;\n3、本品不含乳糖、酵母、糖份、麸质等过敏源，适合过敏人群、糖尿病人群服用！&lt;br /&gt;\n4、本品不含防腐剂！&lt;br /&gt;\n肌肽的营养作用&lt;br /&gt;\n1、延缓衰老，逆转细胞衰老进程，恢复青春活力；&lt;br /&gt;\n2、全面修复受损细胞，延长细胞寿命，使衰老细胞恢复活力；&lt;br /&gt;\n3、清除自由基，减少吸烟产生的游离基，修复或清除被氧化细胞；&lt;br /&gt;\n4、促进脑组织神经元生长、分化和再生，改善脑代谢功能；&lt;br /&gt;\n5、减少肌肤衰老及增白肌肤，祛除褐色斑、老年斑；&lt;br /&gt;\n6、延缓老花眼，预防老年白内障、老年黄斑变性眼病、老年退行性眼病。&lt;br /&gt;\n产品其他相关&lt;br /&gt;\n【注意事项】产品以收到实物为准！&lt;br /&gt;\n【产品优势】&lt;br /&gt;\n&lt;p&gt;\n	本品不含乳糖、酵母、糖份、麸质等过敏源,适合过敏人群、糖尿病人群服用！本品不含防腐剂！\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223133800_58738.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223133801_53708.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223133801_77026.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx14211