(164, 0, 43, 0, '汉诺金费米丹波罗的海青鱼复合片(5230)', 781, 781, 781, 15, 12, 10, '', '品 &amp;nbsp; &amp;nbsp;牌：汉诺金 &lt;br /&gt;\n&lt;br /&gt;\n名 &amp;nbsp; &amp;nbsp;称：汉诺金波罗的海青鱼复合片&lt;br /&gt;\n&lt;br /&gt;\n产 &amp;nbsp; &amp;nbsp;地：芬兰&lt;br /&gt;\n&lt;br /&gt;\n规 &amp;nbsp; &amp;nbsp;格：18g(60片)&lt;br /&gt;\n&lt;br /&gt;\n主要成分：青鱼粉（23.1％）、油菜子粉（5.0%）、针叶樱桃粉（4.6%）、淡水鳕鱼脂肪&lt;br /&gt;\n&lt;br /&gt;\n食用方法：每日2片，(餐后半小时，温水送服）&lt;br /&gt;\n&lt;br /&gt;\n适宜人群：爱美女性；皮肤干黄粗糙人群；欲祛除面部皱纹、鱼尾纹人群；欲丰胸美臀女性；关节磨损老化、韧带硬化、骨质疏松人群。&lt;br /&gt;\n&lt;br /&gt;\n保质期：3年&lt;br /&gt;\n&lt;br /&gt;\n&lt;p&gt;\n	温馨提示：商品图片频繁更换，请以收到实物为准！\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134020_62509.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134021_29856.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134022_17450.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134023_69792.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134023_42747.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134024_39840.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134024_63470.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134024_90543.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134025_28387.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134025_68715.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134025_45761.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134026_74373.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134026_98172.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134027_12512.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134027_90202.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;/p&gt;', 'mhfcjx1421158741', '汉诺金费米丹波罗的海青鱼复合片(5230)', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453539962_ud7r2uptasodzhtk.jpg', 0, 0, 0, 47, 1456281239, 5562, 0, 0),
(165, 0, 51, 0, '玉泽皮肤屏障修护身体乳', 83, 83, 83, 15, 12, 10, '', '&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160222/20160222163159_96241.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160222/20160222163204_45775.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160222/20160222163207_12865.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160222/20160222163214_21713.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160222/20160222163222_33165.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;br /&gt;', 'mhfcjx1421158741', '玉泽皮肤屏障修护身体乳', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453539738_pka61so0kf0yuaau.jpg', 0, 0, 0, 55, 1456281488, 999, 0, 0);
