(166, 0, 43, 0, '健美生绿茶提取物和磷脂复合物浓缩胶囊', 119, 119, 119, 15, 12, 10, '', '产品名称&lt;br /&gt;\n健美生绿茶提取物和磷脂复合物浓缩胶囊(261mg*30粒)&lt;br /&gt;\n产品基本信息&lt;br /&gt;\n【主要成分】精选绿茶提取物、卵磷脂、浓缩绿茶提取物、纤维素等&lt;br /&gt;\n【适宜人群】&lt;br /&gt;\n1、体重超标,欲减肥和控制体重的人士；&lt;br /&gt;\n2、血脂血糖偏高,各种心脑血管疾病患者;&lt;br /&gt;\n3、运动爱好者及衰老速度加快者;&lt;br /&gt;\n4、经常吸烟、饮酒、应酬多的人群;&lt;br /&gt;\n5、长期受电脑和紫外线辐射以及居住或工作生活在环境污染严重地区的人群。&lt;br /&gt;\n【食用方法】每日1次,每次1粒,随餐食用&lt;br /&gt;\n【规 格】261mg*30粒&lt;br /&gt;\n【原 产 地】加拿大&lt;br /&gt;\n【保 质 期】42个月&lt;br /&gt;\n产品介绍&lt;br /&gt;\nJamieson 健美生绿茶提取物和磷脂复合物浓缩胶囊261mg*30粒(进口) 精华配方增加大豆提取的天然磷脂酰胆碱，配合绿茶中的天然磷脂使用，大大提高其抗氧化作用和生物利用度，更易被人体吸收，发挥作用。&lt;br /&gt;\n绿茶精华中还含有许多解毒因子，它们易与血液中有毒物质相结合，并加速其从小便排出。提取出的儿茶素更是具有很高的医用保健功效,因此越来越受到更多人的青睐.绿茶精华中配方中的儿茶素提取精华 - 表没食子儿茶素没食子酸酯(EGCG)是儿茶素中含量最高，最具有医学价值的成分，是一种强效的抗氧化剂。&lt;br /&gt;\n产品特点、优势&lt;br /&gt;\n1、独特的实验室生产工艺,提取自天然绿茶叶的精华营养成分,高倍浓缩,富含丰富的茶多酚及儿茶素；&lt;br /&gt;\n2、添加了磷脂复合物,提高了绿茶提取物的生物利用率；&lt;br /&gt;\n3、通过健美生专有的 360 超纯度检测程序，贯穿于检测、生产、包装全过程，保证原料的可靠性、可追溯性、产品的安全性、高效性和医药级别的纯度。&lt;br /&gt;\n&lt;br /&gt;\n产品其他相关&lt;br /&gt;\n&lt;p&gt;\n	【注意事项】产品以收到实物为准！\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134123_96711.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134124_27981.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134125_26390.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134127_74015.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134128_22035.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134129_42096.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134132_60557.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134133_53781.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134135_44187.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134137_28303.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134138_34112.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134140_41572.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;/p&gt;', 'mhfcjx1421158741', '健美生绿茶提取物和磷脂复合物浓缩胶囊', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453540067_darnxrfw46h3f7y9.jpg', 0, 0, 0, 92, 1456281245, 4662, 0, 0),
(167, 0, 52, 0, '玉泽清痘调护舒缓喷雾(150ml)', 122, 122, 122, 15, 12, 10, '', '&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160123/20160123171024_76457.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160123/20160123171024_52279.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160123/20160123171025_24979.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160123/20160123171025_13875.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160123/20160123171025_74379.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160123/20160123171025_73229.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;', 'mhfcjx1421158741', '玉泽清痘调护舒缓喷雾(150ml)', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453540194_vay1gimz9uddu9zr.jpg', 0, 0, 0, 64, 1456281505, 999, 0, 0),
(168, 0, 43, 0, '健美生葡萄籽浓缩复合片', 99, 99, 99, 15, 12, 10, '', '产品名称&lt;br /&gt;\n健美生葡萄籽浓缩复合片(520mg*60片)&lt;br /&gt;\n产品基本信息&lt;br /&gt;\n【主要成分】浓缩葡萄籽提取物、芦丁、纤维素、磷酸氢钙等&lt;br /&gt;\n【适宜人群】电器辐射、肌肤氧化衰老、肌肤暗沉及色斑、过敏者&lt;br /&gt;\n【食用方法】每日1-2次，每次1片，随餐服用&lt;br /&gt;\n【规 格】520mg/片×60片&lt;br /&gt;\n【原 产 地】加拿大&lt;br /&gt;\n【保 质 期】3年&lt;br /&gt;\n产品介绍&lt;br /&gt;\n葡萄籽是一种富含生物类黄酮OPC的浓缩精华，可用于抵抗自由基，维持毛细血管健康，是一种强有效的天然抗氧化剂。其抗自由基氧化的功效是维生素E的15-25倍，是欧美公认的抗衰老营养补充剂。在欧洲它被用来预防皱纹和抗衰老。葡萄籽也有助于增加血流量和流通，缓解静脉曲张。&lt;br /&gt;\n健美生葡萄籽是选用欧洲酿红酒专用葡萄精制而成，葡萄籽精华素配合葡萄皮(富含多酚类物质)。芦丁及橘皮苷(富含生物类黄酮)，可用于抵抗自由基，更能发挥其作用。其OPC浓缩精华是一种强有效的天然抗氧化剂，并且含丰富的纤维素，对于低纤维饮食的人士非常有效。&lt;br /&gt;\n&lt;br /&gt;\n&lt;br /&gt;\n产品特点、优势&lt;br /&gt;\n1、天然萃取，抗氧化，防辐射，天然护肤专家；&lt;br /&gt;\n2、每片含葡萄籽精华素50mg,相当于3000mg原生葡萄籽提取物。消除自由基导致的皮肤中胶原蛋白过度交联的不利影响，使胶原蛋白始终保持适度交连，达到除皱功效，延缓衰老；&lt;br /&gt;\n3、葡萄籽精华素配合葡萄皮（富含多酚类物质）。芦丁及橘皮苷（富含生物类黄酮），更能发挥其作用；&lt;br /&gt;\n4、含丰富的纤维素,纤维素是多糖化合物，是人类的重要营养元素，帮助促进肠道蠕动，促进消化吸收，这对于低纤维饮食的人士非常有效；&lt;br /&gt;\n5、通过健美生专有的 360 超纯度检测程序，贯穿于检测、生产、包装全过程，保证原料的可靠性、可追溯性、产品的安全性、高效性和医药级别的纯度。&lt;br /&gt;\n&lt;br /&gt;\n&lt;br /&gt;\n&lt;br /&gt;\n&lt;br /&gt;\n产品其他相关&lt;br /&gt;\n&lt;p&gt;\n	【注意事项】产品以收到实物为准！\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134230_84885.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134232_57291.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134234_85638.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134236_55505.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134237_91408.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134239_68946.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134239_72605.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134240_28960.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134241_37011.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;br /&gt;\n&lt;/p&gt;', 'mhfcjx1421158741', '健美生葡萄籽浓缩复合片', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453540192_rju5bbq0880z9xts.jpg', 0, 0, 0, 16, 1456281252, 4526, 0, 0),
