(170, 0, 43, 0, '雷允上超细珍珠粉', 37.8, 37.8, 37.8, 15, 12, 10, '', '品牌：	 雷允上 &lt;br /&gt;\n&lt;br /&gt;\n名称：	 雷允上 &amp;nbsp;超细珍珠粉(300mg*20支)&lt;br /&gt;\n&lt;br /&gt;\n产地：	 浙江		 规格：	 300mg*20支&lt;br /&gt;\n&lt;br /&gt;\n性状：	 粉剂&lt;br /&gt;\n&lt;br /&gt;\n主要原料：	 上乘淡水珍珠&lt;br /&gt;\n&lt;br /&gt;\n保健功能：	 免疫调节&lt;br /&gt;\n&lt;br /&gt;\n食用方法及食用量：	 每日2次，每次2支，用温开水吞食&lt;br /&gt;\n&lt;br /&gt;\n&lt;p&gt;\n	适宜人群：	 免疫力低下者\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134328_24215.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134330_36664.png&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134331_82158.png&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134332_99395.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;/p&gt;', 'mhfcjx1421158741', '雷允上超细珍珠粉', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453540323_wpwgwuhubyltj6uh.jpg', 0, 0, 0, 42, 1456281268, 4523, 0, 0),
