(172, 0, 44, 0, '汉诺金优丽极地蔓越莓片(5310)', 781, 781, 781, 15, 12, 10, '', '品 &amp;nbsp; &amp;nbsp;牌：汉诺金 &lt;br /&gt;\n&lt;br /&gt;\n名 &amp;nbsp; &amp;nbsp;称：汉诺金优丽极地蔓越莓片&lt;br /&gt;\n&lt;br /&gt;\n产 &amp;nbsp; &amp;nbsp;地：芬兰&lt;br /&gt;\n&lt;br /&gt;\n规 &amp;nbsp; &amp;nbsp;格：54g(60片)&lt;br /&gt;\n&lt;br /&gt;\n主要成分：极地蔓越莓粉、菊粉&lt;br /&gt;\n&lt;br /&gt;\n营养作用：维持泌尿系统的健康&lt;br /&gt;\n&lt;br /&gt;\n食用方法：每日2片；(餐后半小时，温水送服）&lt;br /&gt;\n&lt;br /&gt;\n适宜人群：女性泌尿系频繁感染人群；免疫力低下人群；膀胱炎患者；肾结石潜在人群；小便不畅者。&lt;br /&gt;\n&lt;br /&gt;\n保质期：3年&lt;br /&gt;\n&lt;br /&gt;\n&lt;p&gt;\n	温馨提示：商品图片频繁更换，请以收到实物为准！\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134437_50732.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134437_75359.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134438_42257.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134439_85047.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;/p&gt;', 'mhfcjx1421158741', '汉诺金优丽极地蔓越莓片(5310)', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453540444_pgelz1fwy37xzqxg.jpg', 0, 0, 0, 52, 1456281307, 4650, 0, 0),
(173, 0, 54, 0, 'CALGEN Toothpaste羟基磷灰石牙膏', 89, 89, 89, 15, 12, 10, '', '&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160222/20160222163706_69340.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160222/20160222163706_15413.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160222/20160222163708_86814.png&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;br /&gt;', 'mhfcjx1421158741', 'CALGEN Toothpaste羟基磷灰石牙膏', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453540487_fmheee1s2t0jvgjx.jpg', 0, 0, 0, 65, 1456281543, 999, 0, 0),
(174, 0, 45, 0, '澳琳达蜂王浆胶囊', 238, 238, 238, 15, 12, 10, '', '产品名称&lt;br /&gt;\n澳琳达蜂王浆胶囊 31粒&lt;br /&gt;\n产品基本信息&lt;br /&gt;\n【配料】鲜蜂王浆、豆油、卵磷脂、维生素E，胶囊壳为明胶、甘油、纯净水&lt;br /&gt;\n【食用方法】成人每日早上空腹食用1-2粒&lt;br /&gt;\n【保 质 期】3年&lt;br /&gt;\n【贮藏方法】30℃以下避光保存，保质期内胶囊颜色变深，不影响产品质量&lt;br /&gt;\n【原产国】澳大利亚&lt;br /&gt;\n产品介绍&lt;br /&gt;\n神奇的蜂王浆：1、含王浆酸、牛磺酸、维生素和微量元素，可帮助增强免疫力；2、富含维生素、硒、锌、铜、锰、镁等微量元素，消除自由基，从而起到延年益寿的效果；3、含乙酰胆碱能使人进入放松状态，改善失眠、焦虑；4、蜂王浆中的维生素C能增强和提高肝脏的解毒功能，辅助保肝护肝；5、含有丰富核酸，是人类“生命之源”，促进细胞分裂，帮助延缓衰老；6、含有维生素E，可改善肝内微循环，提高肝脏血流量、肝细胞的血液供应，增强食欲及吸收能力。&lt;br /&gt;\n王浆酸的研究：蜂王浆含有优质的蛋白质、脂肪、糖类、维生素A、B1、B2，丰富的叶酸、泛酸及肌醇等30多种营养物质，其中王浆酸是最重要的一种，也是迄今为止自然界仅存于蜂王浆中的一种特殊不饱和脂肪酸——王浆酸，可通过调节提高细胞及体液免疫功能而达到明显的抗癌作用。德国曾对7中不同职业的19026人的调查发现，养蜂者患癌率最低，仅为0.36%，远远低于其他职业2.023%的平均数。80年代初日本公布了王浆酸的抗癌作用。90年代以来，我国的一些试验与临床应用也证实了蜂王浆的抗癌性是王浆酸起作用的结果。&lt;br /&gt;\n澳琳达蜂王浆软胶囊采用“阳光之州”昆士兰州出产的尤加利树蜂胶为原料，天然纯净，无污染，活性高，是澳洲乃至世界的蜂胶原料上品，其次，它为高倍浓缩营养，王浆酸含量高达1.58%（国际标准1.5%），每粒相当于鲜王浆3000mg。再者，特殊工艺处理，非冻干粉未经处理，最大保存营养及生物活性的同时，无需冰箱冷藏，携带、服用方便。&lt;br /&gt;\n产品优势&lt;br /&gt;\n1.100%澳洲原装进口；&lt;br /&gt;\n2.高倍浓缩，王浆酸含量高，每粒=鲜王浆3000mg；&lt;br /&gt;\n3.常温下可保鲜三年的浓缩鲜王浆；&lt;br /&gt;\n4.添加卵磷脂、强化调养。&lt;br /&gt;\n其他相关：&lt;br /&gt;\n为什么澳琳达的瓶口没有塑封？&lt;br /&gt;\n澳琳达用的是国际上最先进的“PE电磁复合膜”，不是普通的硬板纸。这层膜本身有弹性，在受到压力后会嵌在瓶口，并形成密封圈。如果有封口的话，反而会影响密封性，所以这项技术不允许用封口，是技术不同导致的。其实这技术对于开封后的产品保存更好。很多品牌因为做不出PE电磁复合膜，所以必须用塑封。&lt;br /&gt;\n蜂王浆与肥胖&lt;br /&gt;\n服用蜂王浆后，食欲明显改善，因此不少消费者担心是否会发胖的问题：日本东京都大学营养学家研究发现，肥胖的原因是B族维生素供应不足所致，因为B族维生素是机体脂肪转化为能量的媒介。而经常服用蜂王浆，虽然食欲增加，由于蜂王浆含有全面的营养成分，不仅可以为机体组织细胞的生长和修复提供丰富的原料，同时蜂王浆中生物活性物质对机体的各种生理功能具有很好的调节作用，使人体新陈代谢增强，特别是所含的B族维生素，能促使机体脂肪转化为能量。因此，经常服用蜂王浆不仅不会发胖，对某些原因引起的虚胖，体重不会减轻，虚胖消失，身体会变得更加结实健康。&lt;br /&gt;\n蜂王浆与禁忌&lt;br /&gt;\n&lt;p&gt;\n	蜂王浆虽好，但含有天然的激素成分，因此对“激素类敏感体质”者最好经过医生咨询后再考虑是否服用蜂王浆产品。对于蜂产品过敏者、儿童、孕妇、雌激素分泌过量女性（小叶增生、子宫肌瘤、乳腺癌等患者）、甲亢、慢性肾炎、肿瘤患者、手术者不宜服用。\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134550_47260.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134551_43018.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134552_88870.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134554_14769.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134555_70795.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134556_67878.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134557_52310.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134557_45582.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134558_32406.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134600_14583.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134602_30713.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134602_25960.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134603_90374.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134604_62523.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134605_15840.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134606_54446.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;/p&gt;', 'mhfcjx1421158741', '澳琳达蜂王浆胶囊', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453540532_fmo3mczuyijpg62k.jpg', 0, 0, 0, 45, 1456281321, 6589, 0, 0),
(175, 0, 45, 0, '汉诺金麦诺威薯蓣粉复合片(5307)', 898, 898, 898, 15, 12, 10, '', '产品名称&lt;br /&gt;\n汉诺金麦诺威薯蓣粉复合片5307 (60片)&lt;br /&gt;\n产品基本信息&lt;br /&gt;\n【主要成分】薯蓣提取物、大豆提取物、黑豆提取物、鲑鱼提取物、木糖醇&lt;br /&gt;\n【成分含量】蓣皂甙含量为125mg/片；亚麻籽含量为75mg/片；木酚素含量为5mg/片；大豆异黄酮含量为20mg/片；钙含量为233mg/片；维生素D3含量为2.5μg/片；木糖醇含量为117.5mg/片&lt;br /&gt;\n【适宜人群】中老年女性人群；更年期女士；经前综合症&lt;br /&gt;\n【食用方法】每日1-2片,(餐后半小时，温水送服）&lt;br /&gt;\n【产品规格】63g(60片)&lt;br /&gt;\n【原 产 国】芬兰&lt;br /&gt;\n【保 质 期】三年&lt;br /&gt;\n产品介绍&lt;br /&gt;\n芬兰北极圈地区森林密布，水量充沛，夏季日照时间长达16个小时。生长于此的芬兰野生薯蓣富含原薯蓣皂甙，能量充沛，活力十足。野生薯蓣在不同的地域文化中有着不同的用途。希腊人把它当作一种情绪稳定剂来使用，印度和中国人把它当作利尿剂和抗感染抗炎症药剂来使用，同时，它对皮肤的保湿作用和催情剂功能也备受青睐。&lt;br /&gt;\n原薯蓣皂甙&lt;br /&gt;\n原薯蓣皂甙不是一种荷尔蒙，但对于调节男士和女士的荷尔蒙却非常有效。原薯蓣皂甙有降血压、降血脂、抗动脉粥硬化，抗衰老及强壮作用。其中所含的过氧化物分解酶，具有明显的抗衰老作用，可以提高肌体免疫力。&lt;br /&gt;\n原薯蓣皂甙配合大豆异黄酮，可以安全有效调节女性荷尔蒙水平，使之控制在安全合理的范围内。原薯蓣皂甙对女性荷尔蒙的调节功能使它非常适合应用于经期综合症和更年期综合症。 大豆异黄酮即可调节女性荷尔蒙水平，也女性在骨代谢中起到重要的作用，可有效预防骨质疏松。&lt;br /&gt;\n木酚素&lt;br /&gt;\n能抑制卵巢雌激素的合成，降低乳腺癌的发病危险性。&lt;br /&gt;\n产品特点、优势&lt;br /&gt;\n1、纯天然、高含量。&lt;br /&gt;\n2、配方科学、易吸收。&lt;br /&gt;\n3、高质量、高标准&lt;br /&gt;\n4、高品质、无刺激。&lt;br /&gt;\n薯蓣粉的营养作用&lt;br /&gt;\n1、调节女性荷尔蒙；&lt;br /&gt;\n2、预防乳腺癌、卵巢癌、子宫癌；&lt;br /&gt;\n3、平滑、保湿皮肤，让女人继续年轻；&lt;br /&gt;\n4、提高女性性欲，保持美满婚姻生活。&lt;br /&gt;\n产品其他相关&lt;br /&gt;\n【注意事项】产品以收到实物为准！&lt;br /&gt;\n【相关知识】&lt;br /&gt;\n多数女性由于生理和饮食摄入不足，严重缺钙。补充钙是必要的，如骨质疏松症、高血压、结肠癌等。&lt;br /&gt;\n&lt;p&gt;\n	补充天然维生素D3可促进钙吸收和减少骨质流失，预防骨折和软骨病。\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134708_11581.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134709_58569.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134710_46539.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134711_28767.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134712_60570.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134713_93204.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134715_61879.png&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134717_83668.png&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;/p&gt;', 'mhfcjx1421158741', '汉诺金麦诺威薯蓣粉复合片(5307)', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453540644_kqr8uk26jizvmccv.jpg', 0, 0, 0, 45, 1456281327, 4556, 0, 0),
(176, 0, 46, 0, '澳琳达甲壳素胶囊', 289, 289, 289, 15, 12, 10, '', '产品名称&lt;br /&gt;\n澳琳达甲壳素胶囊400mg*60粒&lt;br /&gt;\n产品基本信息&lt;br /&gt;\n【主要成分】甲壳素&lt;br /&gt;\n【适宜人群】&lt;br /&gt;\n1、减肥者（与减肥摇配合效果更好）；&lt;br /&gt;\n2、减肥后需要控制体形的人群；&lt;br /&gt;\n3、应酬多的商务人员；&lt;br /&gt;\n4、嗜好荤食的人群。&lt;br /&gt;\n【食用方法】每日2次，每次1-2粒；餐前10-20分钟食用，至少200cc～300cc水&lt;br /&gt;\n【产品规格】400mg*60粒/瓶&lt;br /&gt;\n【原 产 国】澳大利亚&lt;br /&gt;\n【保 质 期】3年&lt;br /&gt;\n【贮藏方法】避光储藏&lt;br /&gt;\n产品介绍&lt;br /&gt;\n膳食纤维素是人类第六大营养素。&lt;br /&gt;\n膳食纤维素是现代都市人最缺乏的健康元素，经过精制的精细食物容易造成胃肠道蠕动减少，脂肪吸收增加，食物在结肠内停留时间过长而宿便增加，血液内毒素增多，引起一系列的疾病．甲壳素是来自甲壳素类的动物外壳的膳食纤维素。&lt;br /&gt;\n澳琳达甲壳素胶囊采用澳洲塔斯曼尼亚海湾的深海珠贝贝壳，经先进技术加工提取出贝壳纤维素后直接灌注胶囊精制而成。&lt;br /&gt;\n产品特点、优势&lt;br /&gt;\n1、源自纯天然珠贝贝壳，活性高，甲壳素不溶解于水，进入胃肠道后吸水膨胀成一个个带负电的海绵球，可吸附相当自身重量数十倍的脂肪。&lt;br /&gt;\n2、科学配比少量的维生素Ｃ，效果更强．维生素Ｃ可激发甲壳素的吸附能力．避免甲壳素在胃肠道内被氧化失效。&lt;br /&gt;\n&lt;br /&gt;\n&lt;br /&gt;\n&lt;br /&gt;\n产品其他相关&lt;br /&gt;\n【注意事项】产品以收到实物为准！&lt;br /&gt;\n&lt;div&gt;\n	&lt;br /&gt;\n&lt;/div&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134825_40876.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134826_44809.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134827_51004.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134828_57993.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134829_39499.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134830_53143.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134830_26987.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134830_93442.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134832_47084.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134833_43522.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134834_57147.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134835_25514.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134836_48900.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134837_76290.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134838_83309.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134839_69331.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223134841_57864.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;br /&gt;', 'mhfcjx1421158741', '澳琳达甲壳素胶囊', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453540757_b2pfu2rfa2hexrni.jpg', 0, 0, 0, 45, 1456281336, 4565, 0, 0),
(177, 0, 46, 0, '汉诺金卡拉菲红花籽油胶囊(5262)', 601, 601, 601, 15, 12, 10, '', '&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135019_49207.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135020_78488.png&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135024_45905.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135028_38013.png&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135029_11824.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;br /&gt;', 'mhfcjx1421158741', '汉诺金卡拉菲红花籽油胶囊(5262)', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453540864_3lkbet9gruzax4t3.jpg', 0, 0, 0, 52, 1456281343, 4566, 0, 0),
(178, 0, 46, 0, '康比特果蔬代餐粉', 68, 68, 68, 15, 12, 10, '', '产品名称&lt;br /&gt;\n康比特果蔬纤维代餐粉(10g*5条*3盒)&lt;br /&gt;\n产品基本信息&lt;br /&gt;\n【主要成分】魔芋精粉、燕麦纤维、果蔬纤维、矿物质复合物、维生素群&lt;br /&gt;\n【适宜人群】&lt;br /&gt;\n1、长期缺乏运动的办公室白领；&amp;nbsp;&lt;br /&gt;\n2、肥胖者；&amp;nbsp;&lt;br /&gt;\n3、需要维持体型的人士；&lt;br /&gt;\n4、水果蔬菜摄入不足者；&lt;br /&gt;\n5、便秘者。&lt;br /&gt;\n【食用方法】取一袋溶于250-300ml的温水中，搅拌均匀即可饮用，代替晚餐或中餐。加入酸奶或干果（如葡萄干、花生、黑芝麻）口感更好&lt;br /&gt;\n【规 格】10g/袋*5袋/盒*3盒&lt;br /&gt;\n【原 产 地】北京&lt;br /&gt;\n【保 质 期】24个月&lt;br /&gt;\n【卫生许可号】QS112107011139&lt;br /&gt;\n产品介绍&lt;br /&gt;\n康比特果蔬纤维代餐粉以天然优质的魔芋精粉、燕麦纤维、果蔬纤维、矿物质复合物、以及多种人体所必需的维生素群构成。可以很好的增加饱腹感，减少热量营养素的吸收。&lt;br /&gt;\n产品特点、优势&lt;br /&gt;\n1、低卡路里，热量控制在10KCAL/餐以内。&lt;br /&gt;\n2、营养充足多种维生素矿物质丰富，保证人体所需。&lt;br /&gt;\n3、饱腹清肠魔芋，柑橘纤维，燕麦纤维小麦纤维加快毒素排出。&lt;br /&gt;\n产品其他相关&lt;br /&gt;\n&lt;p&gt;\n	【注意事项】产品以收到实物为准！\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135116_72177.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135118_84067.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135120_81914.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135121_33977.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135124_87460.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135125_24096.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135127_53477.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135129_94458.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135131_68603.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135132_13751.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135136_54427.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135138_65967.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;/p&gt;', 'mhfcjx1421158741', '康比特果蔬代餐粉', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453540937_fb70bvipmoh01mfc.jpg', 0, 0, 0, 25, 1456281350, 4766, 0, 0),
(179, 0, 46, 0, '蜀宝牌蜀宝减肥胶囊', 168, 168, 168, 15, 12, 10, '', '产品名称&lt;br /&gt;\n蜀宝牌蜀宝减肥胶囊(0.2g*100粒）&lt;br /&gt;\n产品基本信息&lt;br /&gt;\n【主要成分】绞股蓝、黄芪、陈皮、莱菔子、草决明、枸杞子、荷叶、山楂、海藻、绿茶&lt;br /&gt;\n【功效成分及含量	】每100g含：总黄酮≧100mg 茶多酚≧50mg 总皂甙≧540mg&lt;br /&gt;\n【保健功能】减肥&lt;br /&gt;\n【适宜人群】单纯性肥胖&lt;br /&gt;\n【不适宜人群】孕期和哺乳期妇女，儿童及严重心脏病患者&lt;br /&gt;\n【食用方法及食用量】口服，每日2-3次，每次4粒&lt;br /&gt;\n【规 格】0.2g*100粒/瓶&lt;br /&gt;\n【原 产 地】中国&lt;br /&gt;\n【保 质 期】18个月&lt;br /&gt;\n【贮藏方法】密封，置于阴凉干燥处&lt;br /&gt;\n【注意事项】减至正常体重后，勿需再食用&lt;br /&gt;\n【产品批准文号】卫食健字（1999）第0190号&lt;br /&gt;\n【产品执行标准】Q/SCG0001S&lt;br /&gt;\n【保健食品生产许可证号】 川健生证字[2010]第0003号&lt;br /&gt;\n蜀宝减肥胶囊介绍&lt;br /&gt;\n蜀宝牌蜀宝减肥胶囊是采用中国传统的中医药理论从天然的植物中提炼植物精华生产的减肥产品，能提高人体的新陈代谢，促进肥胖部位TGE的分泌量，加快体内多余脂肪的燃烧。可全面清除腰腹部、腿部、手臂脂肪，无论男女，越是脂肪多的地方，减肥速度越快。&lt;br /&gt;\n蜀宝牌蜀宝减肥胶囊以天然植物绞股蓝、黄芪、莱菔子、草决明、枸杞子、绿茶等为主要原料，采用先进工艺提取有效成分，经过加工而制成的一种减肥保健食品，经人体功能试验证实，受试者食用45天后，体内脂肪总量、体重显著下降，腰围、腹围、臀围和皮下脂肪厚度均明显减小，体重平均下降4.5公斤，具有减肥保健作用。&lt;br /&gt;\n蜀宝减肥胶囊主要原料&lt;br /&gt;\n绞股蓝：改善人体代谢，促进机能正常运转，降血压、降血脂、降血糖。&lt;br /&gt;\n草决明: 具有清热平肝、降脂降压、润肠通便之功效，特别适用于肥胖和便秘。&lt;br /&gt;\n枸杞子: 润而滋补，兼能退热，具有延缓衰老、生津润肺、调节血脂和血糖的功效。&lt;br /&gt;\n绿茶：提神清心、消食化痰、去脂减肥，另外亦可养容美颜，让肌肤更细嫩。&lt;br /&gt;\n荷叶: 荷叶含有荷叶碱，可扩张血管清热解暑，有降血压作用，同时还是减肥良药。&lt;br /&gt;\n山楂: 改善心脏活力、降低血压和胆固醇，能开胃消食，特别对消肉食积滞作用更明显。&lt;br /&gt;\n蜀宝减肥胶囊原理&lt;br /&gt;\n蜀宝减肥胶囊能迅速激发肥胖部位TGE的分泌量，并将多余脂肪分解转化为能量而消耗，调节人体阴阳，通滞排毒、活血化瘀、在促进TGE分泌的过程中，具有明确的选择，即只增加腹部、臀部、大腿部、内脏等脂肪易囤积处的TGE分泌，因而不影响胸部的丰满。其作用机制明确、不作用于大脑、不进入血液、能阻断膳食脂肪的吸收、平衡脂肪代谢、补充脂肪细胞分化因子、增强脂肪分解能力、抑制体内新脂肪的形成。符合国际卫生组织WHO提出的减肥五大标准：不厌食、不乏力、不腹泻、不脱水、无毒性，达到科学、健康、轻松减肥之目的。&lt;br /&gt;\n蜀宝减肥胶囊功效&lt;br /&gt;\n蜀宝减肥胶囊内含多种减脂功效成份，从根本上清脂降脂，能有效分解脂肪，快速将肥胖者因脂肪堆积导致的“肥胖机体状态”调节到“正常机体状态”，减脂的同时阻断脂肪再积蓄的通路，使身体热量产生负平衡，从而快速地促进脂肪转化为能量。&lt;br /&gt;\n蜀宝减肥胶囊特点&lt;br /&gt;\n1、蜀宝减肥胶囊属卫食健字，长期服用无毒副作用，安全有效。食用10天后，体内脂肪总量显著下降，腰围、腹围和皮下脂肪厚度均明显减少。经卫生部人体功能试验证实，受试者食用45天后，根据人体自身体质差异能减脂6-30斤，腰腹缩减3-10厘米。&lt;br /&gt;\n2、蜀宝减肥胶囊一切源于草本植物精华，不含任何西药成分和激素，不作用于大脑、不进入血液，是通过加速燃烧脂肪和消耗热量达到瘦身效果，因此不会对人体产生任何副作用。&lt;br /&gt;\n3、蜀宝减肥胶囊在减脂的同时阻断脂肪再积蓄的通路，使身体热量产生负平衡，从而快速地促进脂肪转化为能量，并有效地控制反弹。&lt;br /&gt;\n4、蜀宝减肥胶囊服用期间无需节食、无需戒食，无需运动，并且服用方便。&lt;br /&gt;\n蜀宝减肥胶囊适用范围&lt;br /&gt;\n1、顽固性肥胖者：使用其他减肥产品无效或反弹者；&lt;br /&gt;\n2、产后肥胖：因生小孩而小腹突出走样的年轻妈妈；&lt;br /&gt;\n3、中年性肥胖：中年发胖发福，身材严重走形的人；&lt;br /&gt;\n4、局部肥胖：主要消除腹部、臀部、大腿等处的多余脂肪。&lt;br /&gt;\n蜀宝减肥胶囊服用效果&lt;br /&gt;\n第一阶段：排毒期（1-3天）：在此阶段少部分人可达到良好减肥效果，多数人大便次数增多，这是正常的生理现象，说明体内的毒素和脂肪开始顺畅排出体外。&lt;br /&gt;\n第二阶段：起效期（6-10天）：本阶段90%以上的人已经有了不同程度的减肥效果，多数人减重可达3-5斤，并且皮肤开始变得光滑细嫩，小腹、腰部及背部的赘肉明显减少。&lt;br /&gt;\n第三阶段：显效期（20-30天）：本阶段98%的人群减肥效果显著，大多数人减重可达8-12斤，伴随体重的下降，肤色得到改善，腰围、臀围平均缩小3-10厘米。&lt;br /&gt;\n&lt;p&gt;\n	第四阶段：巩固期（50-60天） ：根据研究实验显示，大多数人可减半用量服用健佰龄减肥胶囊50-60天，直至减到理想的体重。\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135218_89550.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135219_60330.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135220_78049.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135222_16108.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135224_11401.png&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160223/20160223135226_36106.png&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;/p&gt;', 'mhfcjx1421158741', '蜀宝牌蜀宝减肥胶囊', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/01/23/1453541028_gd48i96omdm6pix0.jpg', 0, 0, 0, 41, 1456281356, 4523, 0, 0),
