(288, 0, 72, 0, '容美焕肤活性水( Miracle Shine Facial Activator )', 9999, 9999, 9999, 15, 12, 10, '', '&lt;p class=&quot;MsoNormal&quot;&gt;\n	&lt;strong&gt;有效成份：&lt;/strong&gt;神经肽&lt;span&gt;-7&lt;/span&gt;，碳酸氢钠，碳酸钾，碳酸钠，碳酸锶，银离子，纳米&lt;span&gt; - &lt;/span&gt;金，钙，锗，硒，锌，镁，锂，硼，活性水。&lt;span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot;&gt;\n	&lt;strong&gt;功效特点&lt;/strong&gt;：能够恢复皮下胶原蛋白的弹性，使其具有光泽、弹性、饱和度、加速皮肤细胞角质层脱落、更新、迅速缩紧皮肤、除皱、渗透力强，并能保持皮肤的水分、增白、分解多余油脂，帮助排出使用铅、汞、激素类功能性产品所存在皮肤和体内的毒素。&lt;span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot;&gt;\n	可以提升面部肌肤，亦可收敛，抗衰。效果绝佳！效果可以达到非手术整形，可以改善脸部任何问题，抗老去皱，抗敏感去痘印，收紧提升皮肤，收细毛孔祛斑祛黄，祛黑眼圈，祛眼袋去鱼尾纹。\n&lt;/p&gt;\n&lt;p style=&quot;background:#FDFDFD;vertical-align:baseline;&quot;&gt;\n	&lt;strong&gt;使用方法&lt;/strong&gt;：&lt;span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;background:#FDFDFD;vertical-align:baseline;&quot;&gt;\n	【外涂使用方法】早晚洁面后，取2-3滴在手心混合后均匀涂于面颈部，轻拍面部至吸收。&lt;span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;background:#FDFDFD;vertical-align:baseline;&quot;&gt;\n	【内服使用方法】产品是以纯天然矿物质为主要原料，产品无色无味、无毒性、无公害，来自自然，婴儿孕妇皆可适用。补矿充人体所需多种天然矿物质，含锗、锶、银、金等，通过聚合酶链式纳米技术，变成液态，充分被人体吸收，开创了药用矿物质技术新纪元，开创了纳米黄金保健新纪元，从细胞分子层面上解决人类健康和皮肤老化问题。并从口腔、食道、胃肠至周身大量释放远红外线放射体，所到之处随着内粘膜及血液吸收，活化细胞，可预防、治疗过敏体质、亚健康、和酸性体质所引起的各种疾病。能消除病原菌，顽固性红菌、顽固性病毒，免疫功能酶抗体的生成能力可增加2-4倍。有益于各种癌症的治疗及、心脏病、糖尿病、高血压、关节炎、腰腿疼痛、神经系统疾病、遗传病、风湿病、恶性皮肤病。长期服用，大便臭味减少。这是任何一种产品所无法替代的，是世界上最新的既具保健功能又起到治疗作用的高科技专利产品，是超现代一流、新型、非常惊奇幻想的产品，可谓生命活化能。&lt;span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;background:#FDFDFD;vertical-align:baseline;&quot;&gt;\n	&amp;nbsp;\n&lt;/p&gt;\n&lt;p style=&quot;background:#FDFDFD;vertical-align:baseline;&quot;&gt;\n	&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160217/20160217164836_61321.jpg&quot; alt=&quot;&quot; /&gt;\n&lt;/p&gt;', 'mhfcjx1421158741', '容美焕肤活性水( Miracle Shine Facial Activator )', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/02/17/1455698873_wn6a0tbml3mrhcjb.jpg', 0, 0, 0, 0, 1456295124, 999, 0, 0),
(293, 0, 68, 0, '新西兰【Biohoney】山毛榉甘露蜂蜜 美容养颜 肠胃健康 增强免疫 清肠排毒 改善便秘 Honeydew 250g', 109, 109, 119, 15, 12, 9.2, '', '&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160219/20160219135104_93614.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160219/20160219135107_85274.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160219/20160219135109_77384.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160219/20160219135110_24516.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;', 'mhfcjx1421158741', '新西兰【Biohoney】山毛榉甘露蜂蜜 美容养颜 肠胃健康 增强免疫 清肠排毒 改善便秘 Honeydew 250g', 0, 'http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/2016/02/19/1455861013_pz9txfor8gpq6f9c.png', 0, 0, 0, 34, 1456294770, 1998, 0, 0),
(289, 0, 72, 0, '容美焕肤活性油(Miracle Shine Facial Conformer)', 9999, 9999, 9999, 15, 12, 10, '', '&lt;p class=&quot;MsoNormal&quot;&gt;\n	&lt;strong&gt;有效成份：&lt;/strong&gt;神经肽&lt;span&gt;-5&lt;/span&gt;，灵芝孢子提取物，谷胱甘肽，野生玫瑰果油，&lt;span&gt;VC&lt;/span&gt;酯，胶原蛋白，&lt;span&gt;EGF&lt;/span&gt;生长肽，高纯氧，&lt;span&gt;VB3&lt;/span&gt;，&lt;span&gt;VPP&lt;/span&gt;，&lt;span&gt;DPHP&lt;/span&gt;固化剂&lt;span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot;&gt;\n	减少黑斑。改善皮肤的弹性，色调和纹理。减少细纹和皱纹。&lt;span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot;&gt;\n	警告：只供外用，中止如果出现症状。避免直接接触眼睛，远离儿童接触不到的地方。&lt;span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot;&gt;\n	&lt;strong&gt;功效特点&lt;/strong&gt;：减少黑斑。改善皮肤的弹性，色调和纹理。减少细纹和皱纹。&lt;span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;background:#FDFDFD;vertical-align:baseline;&quot;&gt;\n	&lt;strong&gt;使用方法&lt;/strong&gt;：&lt;span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;background:#FDFDFD;vertical-align:baseline;&quot;&gt;\n	早晚洁面后，取容美活性油 2-3滴在手心混合后均匀涂于面颈部，按至吸收（或用超声波导入）特别干燥肌肤前期可加涂保湿去皱面霜，一周后直接用源液即可。&lt;span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;background:#FDFDFD;vertical-align:baseline;&quot;&gt;\n	&amp;nbsp;\n&lt;/p&gt;\n&lt;p style=&quot;background:#FDFDFD;vertical-align:baseline;&quot;&gt;\n	使用后会感觉有微热属正常现象，因为它通过面部皮肤迅速渗透到皮肤的基底层，其营养成分给细胞注入能量，又因为新陈代谢的提升加速了能量燃烧导致有微热的感觉，若有红血丝的客户需要先修复红血丝后再使用灵芝孢子产品，因为灵芝孢子的活性成分会加速毛细血管微循环会使红血丝浮现。\n&lt;/p&gt;\n&lt;p style=&quot;background:#FDFDFD;vertical-align:baseline;&quot;&gt;\n	&amp;nbsp;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot;&gt;\n	每天洁面后先用容美活性神水， 然后再用容美活性神油，建议在使用本产品期间，配合使用补水面膜或保湿霜。\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot;&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot;&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot;&gt;\n	&lt;img src=&quot;http://wdscpt.b0.upaiyun.com/mhfcjx1421158741/image/20160217/20160217165044_42743.jpg&quot; alt=&quot;&quot; /&gt;\n&lt;/p&gt;', 'mhfcjx1421158741', '容美焕肤活性油(Miracle Shine Facia